import React, { useState } from 'react';
import '../styles/savings.css';

export default function SavingsPage() {
  const [amount, setAmount] = useState('');
  const [category, setCategory] = useState('');
  const [date, setDate] = useState('');
  const [entries, setEntries] = useState([]);

  const handleSubmit = (e) => {
    e.preventDefault();
    if (amount && category && date) {
      const newEntry = { amount, category, date };
      setEntries([...entries, newEntry]);
      setAmount('');
      setCategory('');
      setDate('');
    }
  };

  return (
    <div className="v32_292">
      {/* Header */}
      <div className="v32_297">
        <h1 className="v32_327">Budget Wallet</h1>
        
        {/* Navigation */}
        <div style={{ position: 'absolute', top: '21px', left: '300px' }}>
          <div className="v97_123">
            <div className="v97_124">Savings</div>
          </div>
        </div>
        
        <div style={{ position: 'absolute', top: '21px', left: '532px' }}>
          <div className="v97_117">
            <div className="v97_118">Budget</div>
          </div>
        </div>
        
        <div style={{ position: 'absolute', top: '21px', left: '764px' }}>
          <div className="v97_126">
            <div className="v97_127">Expense</div>
          </div>
        </div>
        
        <div style={{ position: 'absolute', top: '21px', left: '996px' }}>
          <div className="v97_120">
            <div className="v97_121">Account</div>
          </div>
        </div>
        
        <div style={{ position: 'absolute', top: '23px', left: '1228px' }}>
          <div className="v97_129">
            <div className="v97_130">More</div>
          </div>
        </div>
        
        <div className="v97_24"></div>
      </div>
      
      {/* Sidebar */}
      <div className="v32_293">
        <span className="v32_312">Summary</span>
      </div>
      
      <div className="v32_296">
        <span className="v32_313">Income</span>
      </div>
      
      <div className="v32_294">
        <span className="v32_295">Savings</span>
      </div>
      
      <div className="v32_380">
        <span className="v32_381">Report</span>
      </div>
      
      {/* Main Content */}
      <div style={{ position: 'absolute', top: '214px', left: '329px' }} className="v32_314">
        <div className="v32_315">
          {/* Date and Category Filters */}
          <div className="v109_24">
            <span className="v109_26">Date</span>
          </div>
          
          <div className="v32_316">
            <span className="v32_321">Category</span>
          </div>
          
          {/* Form Elements */}
          <div className="v32_320">
            <div className="v32_330">Savings amount</div>
            <input 
              className="v32_328"
              type="number"
              value={amount}
              onChange={(e) => setAmount(e.target.value)}
              placeholder="Enter amount"
              style={{ paddingLeft: '10px' }}
            />
            
            <div className="v32_329">Category</div>
            <input 
              className="v32_326"
              type="text"
              value={category}
              onChange={(e) => setCategory(e.target.value)}
              placeholder="Enter category"
              style={{ paddingLeft: '10px' }}
            />
            
            <div className="v32_324">Date</div>
            <input 
              className="v32_323"
              type="date"
              value={date}
              onChange={(e) => setDate(e.target.value)}
              style={{ paddingLeft: '10px' }}
            />
            
            <button className="v32_322" onClick={handleSubmit}>
              <span className="v32_325">Save</span>
            </button>
          </div>
        </div>
      </div>
      
      {/* Savings List */}
      <div style={{ 
        position: 'absolute', 
        top: '650px', 
        left: '329px', 
        width: '963px',
        backgroundColor: '#ffffff',
        padding: '20px',
        borderRadius: '45px',
        boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)'
      }}>
        <h3 style={{ fontFamily: 'Kaisei Decol', fontSize: '24px', marginBottom: '20px' }}>Savings Entries</h3>
        <ul style={{ listStyle: 'none', padding: '0' }}>
          {entries.map((entry, index) => (
            <li key={index} style={{ 
              padding: '10px', 
              margin: '5px 0', 
              backgroundColor: '#f5f5f5',
              borderRadius: '10px',
              fontFamily: 'Kaisei Decol'
            }}>
              ${entry.amount} - {entry.category} on {entry.date}
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}
